INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 137001, 10032, "2025/06/23 14:59:59", "デュラン", 2002, 2, 8, 1, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", -470.0, "2025/03/15 15:00:00", 0.0, 1);
