INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 135902, 10034, "2025/09/23 14:59:59", "サツキ", 2002, 2, 9, 2, "おう\n好きなもん持ってきな", -470.0, "2025/06/16 15:00:00", 0.0, 1);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 135902, 10035, "2025/09/23 14:59:59", "サツキ", 2002, 1, 9, 6, "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", -470.0, "2025/06/16 15:00:00", 4.935, 2);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 135802, 10036, "2025/09/23 14:59:59", "ユキノ", 2002, 2, 9, 5, "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", -470.0, "2025/06/16 15:00:00", 7.441, 1);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 135802, 10037, "2025/09/23 14:59:59", "ユキノ", 2002, 7, 9, 7, "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", -470.0, "2025/06/16 15:00:00", 0.0, 2);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 130901, 10038, "2025/12/23 14:59:59", "クルル", 2002, 2, 10, 2, "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", -470.0, "2025/09/16 15:00:00", 2.295, 1);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 130901, 10039, "2025/12/23 14:59:59", "クルル", 2002, 1, 10, 6, "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", -470.0, "2025/09/16 15:00:00", 6.281, 2);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 137701, 10040, "2025/12/23 14:59:59", "ヴォルガーノ", 2002, 2, 10, 1, "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", -470.0, "2025/09/16 15:00:00", 5.549, 1);
INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (0.0, 137701, 10041, "2025/12/23 14:59:59", "ヴォルガーノ", 2002, 3, 10, 6, "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", -470.0, "2025/09/16 15:00:00", 2.64, 2);
